{/* Content */ }
<div style={styles.content}>
    {/* Welcome Section */}
    <div style={styles.welcomeSection}>
        <h1 style={styles.welcomeTitle}>Welcome to DSCE Campus</h1>
        <p style={styles.welcomeSubtitle}>Access your portal and manage your academic journey</p>
    </div>

    {/* Main Portal Section */}
    <div style={styles.mainSection}>
        {/* Logo */}
        <div style={styles.logoSection}>
            <div
                style={styles.logoCircle}
                onMouseEnter={(e) => handleLogoHover(e, true)}
                onMouseLeave={(e) => handleLogoHover(e, false)}
            >
                <div style={styles.logoText}>
                    DSCE
                    <br />
                    LOGO
                </div>
            </div>
        </div>

        {/* Portal Buttons */}
        <div style={styles.buttonsSection}>
            <div style={styles.portalCard}>
                <h2 style={styles.cardTitle}>Portal Access System</h2>

                <div style={styles.buttonsContainer}>
                    {/* Student Portal */}
                    <button
                        style={{ ...styles.portalButton, ...styles.studentBtn }}
                        onClick={() => handlePortalClick("Student")}
                        onMouseEnter={(e) => handleButtonHover(e, true)}
                        onMouseLeave={(e) => handleButtonHover(e, false)}
                    >
                        <div style={styles.buttonContent}>
                            <span style={styles.buttonIcon}>üë®‚Äçüéì</span>
                            <span>Student Portal</span>
                        </div>
                    </button>

                    {/* Teacher Portal */}
                    <button
                        style={{ ...styles.portalButton, ...styles.teacherBtn }}
                        onClick={() => handlePortalClick("Teacher")}
                        onMouseEnter={(e) => handleButtonHover(e, true)}
                        onMouseLeave={(e) => handleButtonHover(e, false)}
                    >
                        <div style={styles.buttonContent}>
                            <span style={styles.buttonIcon}>üë©‚Äçüè´</span>
                            <span>Teacher Portal</span>
                        </div>
                    </button>

                    {/* Admin Dropdown */}
                    <div style={styles.dropdownContainer} ref={dropdownRef}>
                        <button
                            style={{ ...styles.portalButton, ...styles.adminBtn }}
                            onClick={() => setDropdownOpen(!dropdownOpen)}
                            onMouseEnter={(e) => handleButtonHover(e, true)}
                            onMouseLeave={(e) => handleButtonHover(e, false)}
                        >
                            <div style={styles.buttonContent}>
                                <span style={styles.buttonIcon}>üîß</span>
                                <span>Admin Panel</span>
                                <span style={styles.dropdownArrow}>‚ñº</span>
                            </div>
                        </button>

                        {/* Dropdown Menu */}
                        <div style={styles.dropdownMenu}>
                            {adminOptions.map((option, index) => (
                                <div
                                    key={option.key}
                                    style={{
                                        ...styles.dropdownItem,
                                        borderBottom: index === adminOptions.length - 1 ? 'none' : '1px solid #475569'
                                    }}
                                    onClick={() => handleAdminOption(option.key)}
                                    onMouseEnter={(e) => handleDropdownItemHover(e, true)}
                                    onMouseLeave={(e) => handleDropdownItemHover(e, false)}
                                >
                                    <span style={styles.dropdownIcon}>{option.icon}</span>
                                    <span>{option.label}</span>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>
